import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from './Components/Home';

function App() {
  return (
    <div className="app">
      <Router>
        <Switch>

          <Route exact path='/' component={Home} />

        </Switch>
      </Router>
    </div>
  );
}

export default App;
